access.description:
Optional. An array of objects that define dataset access for one or more
entities. You can set this property when inserting or updating a dataset in
order to control who is allowed to access the data. If unspecified at
dataset creation time, BigQuery adds default dataset access for the
following entities: access.specialGroup: projectReaders; access.role:
READER; access.specialGroup: projectWriters; access.role: WRITER;
access.specialGroup: projectOwners; access.role: OWNER;
access.userByEmail: [dataset creator email]; access.role: OWNER;

type.description:
Optional. The type of this parameter. Absent if not explicitly
specified (e.g., CREATE FUNCTION statement can omit the return type;
in this case the output parameter does not have this "type" field).

StandardSqlDataType.description:
The type of a variable, e.g., a function argument.
Examples:
INT64: {type_kind="INT64"}
ARRAY<STRING>: {type_kind="ARRAY", array_element_type="STRING"}
STRUCT<x STRING, y ARRAY<DATE>>:
  {type_kind="STRUCT",
   struct_type={fields=[
     {name="x", type={type_kind="STRING"}},
     {name="y", type={type_kind="ARRAY", array_element_type="DATE"}}
   ]}}

AuditConfig.description:
Specifies the audit configuration for a service.
The configuration determines which permission types are logged, and what
identities, if any, are exempted from logging.
An AuditConfig must have one or more AuditLogConfigs.

If there are AuditConfigs for both `allServices` and a specific service,
the union of the two AuditConfigs is used for that service: the log_types
specified in each AuditConfig are enabled, and the exempted_members in each
AuditLogConfig are exempted.

Example Policy with multiple AuditConfigs:

    {
      "audit_configs": [
        {
          "service": "allServices"
          "audit_log_configs": [
            {
              "log_type": "DATA_READ",
              "exempted_members": [
                "user:jose@example.com"
              ]
            },
            {
              "log_type": "DATA_WRITE",
            },
            {
              "log_type": "ADMIN_READ",
            }
          ]
        },
        {
          "service": "sampleservice.googleapis.com"
          "audit_log_configs": [
            {
              "log_type": "DATA_READ",
            },
            {
              "log_type": "DATA_WRITE",
              "exempted_members": [
                "user:aliya@example.com"
              ]
            }
          ]
        }
      ]
    }

For sampleservice, this policy enables DATA_READ, DATA_WRITE and ADMIN_READ
logging. It also exempts jose@example.com from DATA_READ logging, and
aliya@example.com from DATA_WRITE logging.

AuditLogConfig.description:
Provides the configuration for logging a type of permissions.
Example:

    {
      "audit_log_configs": [
        {
          "log_type": "DATA_READ",
          "exempted_members": [
            "user:jose@example.com"
          ]
        },
        {
          "log_type": "DATA_WRITE",
        }
      ]
    }

This enables 'DATA_READ' and 'DATA_WRITE' logging, while exempting
jose@example.com from DATA_READ logging.
